class PassoPassoReserva extends DocBase {
    constructor() {
        super();
        // --- BASE64 DO FUNDO (PASSO A PASSO) ---
        // 1. Tire print ou salve seu PDF de "Passo a Passo" como imagem.
        // 2. Converta para Base64.
        // 3. Cole abaixo.
        this.fundoBase64 = "data:image/jpeg;base64,"; 
    }

    gerar() {
        if (!this.checkLib()) return;
        const { jsPDF } = window.jspdf;
        
        if (!this.fundoBase64) {
            alert("ATENO: Cole o Base64 da imagem no arquivo 'passo-passo.js'!");
            return;
        }

        const doc = new jsPDF(); // A4

        try {
            // Desenha a imagem na folha inteira
            doc.addImage(this.fundoBase64, 'PNG', 0, 0, 210, 297);
        } catch (e) {
            console.error(e);
            alert("Erro na imagem de fundo.");
        }

        window.open(doc.output('bloburl'), '_blank');
    }
}